// Convert all numbers to numeral.js objects
overall.standings = overall.standings.map(function(team){
  tempRoster = team.roster.map(function(golfer){
    return {
      golfer: golfer.golfer,
      earnings: numeral(golfer.earnings)
    };
  });
  return {
    team: team.team,
    earnings: numeral(team.earnings),
    balance: numeral(team.balance),
    roster: tempRoster
  }
});







$(function() {
  filltheTable();
});


function filltheTable() {
  $.each(overall.standings, function(i, team) {
      if (team.balance.value() > 0)
      { cssClass = "success"}
      else if (team.balance.value() < 0)
      {
        cssClass = "danger"
      }
      else
      {
          cssClass = "default"
      }

      htmlString = "<div class='panel panel-default'>"
                + "<a class='click-track' data-toggle='collapse' href='#collapse" + i+1 + "'>"
                + "<div class='panel-heading'>"
                + "<h4 class='panel-title'>"
                + "<span class='pull-left label label-default'>" + team.earnings.format('$0,0') + "</span>"
                + "<span class='team-name'>" + (i+1) + " - " + team.team
                //+"(" + team.players.length + ")"
                + "</span>"
                + "<span class='pull-right label label-"
                + cssClass
                + "'>" + team.balance.format('$0,0') + "</span>"
                + "</h4></div></a>"
                + "<div id='collapse" + i+1 + "' class='panel-collapse collapse'><table class='table-bordered table-condensed'>"
                + "<thead><tr>"
                + "<th>Golfer</th>"
                + "<th>Earnings</th>"
                + "</tr></thead>";

      $.each(team.roster, function(index, player) {
        htmlString += "<tr width='100%'>"
                    + "<td>" + player.golfer + "</td>"
                    + "<td>" + player.earnings.format('$0,0') + "</td>"
                    + "</tr>"
      });

      htmlString+= "</table></ul></div></div>";

      $(".panel-group").append(htmlString);

      });

      $(".tournament-name").html("<h1>Overall Standings (as of: " + overall.asOf + ")</h1>");
    };
